import React, { useState } from "react";
import "./App.css";

function App() {
  const [showLogin, setShowLogin] = useState(false);

  const handleLoginClick = () => {
    setShowLogin(true);
  };

  const handleBackClick = () => {
    setShowLogin(false);
  };

  return (
    <div className="welcome-container">
      <div className="welcome-content">
        <h1 className="main-title">PROPSUITE</h1>
        <hr className="divider" />
        {!showLogin ? (
          <>
            <h2 className="subtitle">
              ¡Gestión de edificios al alcance de tus manos!
            </h2>
            <div className="button-container">
              <button className="custom-button" onClick={handleLoginClick}>
                Iniciar Sesión
              </button>
              <button className="custom-button">Registrarse</button>
            </div>
          </>
        ) : (
          <div className="form-horizontal">
            <div className="input-group">
              <label>Usuario</label>
              <input type="text" placeholder="Ingrese su usuario" />
            </div>
            <div className="input-group">
              <label>Contraseña</label>
              <input type="password" placeholder="Ingrese su contraseña" />
            </div>
            <div className="button-container">
              <button className="custom-button">Iniciar Sesión</button>
              <button className="custom-button" onClick={handleBackClick}>
                Volver
              </button>
            </div>
          </div>
        )}
      </div>
    </div>
  );
}

export default App;

